import React from "react";
import GenericDivBlock from "../GenericComponents/GenericDivBlock";

const ContentRow = () => {
  return (
    <React.Fragment>
      <div className="row">
        {/* <!-- Area Chart --> */}
        <GenericDivBlock
          col="col-xl-8 col-lg-7"
          Heading="Earnings Overview"
          dropDownHeading="DropDown Menu"
          dropDown={["item1", "item2", "item3"]}
        />
        <GenericDivBlock
          col="col-xl-4 col-lg-5"
          Heading="Revenue Sources"
          dropDownHeading="DropDown"
          dropDown={["item11", "item22", "item33"]}
        />
      </div>
    </React.Fragment>
  );
};

export default ContentRow;
